import React from "react";

const FormSuccess = () => {
  return (
    <div className="form-content-right">
      <h1 className="form-success">We have ereceived your request!</h1>
      <img className="form-img-2" src="images/img-3.svg" alt="" />
    </div>
  );
};

export default FormSuccess;
